class City_list_model {
  List<City> _city;

  List<City> get city => _city;

  City_list_model({List<City> city}) {
    _city = city;
  }

  City_list_model.fromJson(dynamic json) {
    if (json["city"] != null) {
      _city = [];
      json["city"].forEach((v) {
        _city.add(City.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    if (_city != null) {
      map["city"] = _city.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

